<?php

ini_set('display_errors', 1);
error_reporting(e_all);

if( !isset( $_SERVER['HTTP_AUTHORIZATION'] ) || ($_SERVER['HTTP_AUTHORIZATION']=="") ) {
	http_response_code(401) ;
	header( "HTTP/1.1 401 Unauthorized" ) ;
	header( "WWW-Authenticate: Basic realm=\"Insert credentials\"" );
	echo "You are not authorized to access this page." ;
	exit(0);
}
if( $_SERVER['HTTP_AUTHORIZATION']!=("Basic ".base64_encode( preg_replace("/[\\r\\n]*$/","",file_get_contents("pass/password.inc")) )) ) {
	http_response_code(403) ;
	header( "HTTP/1.1 403 Forbidden" ) ;
	echo "Forbidden." ,
	exit(0);
}

if( isset($_REQUEST['page']) && isset($_REQUEST['data']) ) {
	header( "Content-type: text/plain" ) ;
	header( "Expires: 0" ) ;
	file_put_contents( $_REQUEST['page'], base64_decode($_REQUEST['data']) ) ;
	echo  "page=".$_REQUEST['page']."\ndata=".base64_decode($_REQUEST['data']) ;
	exit(0);
} else {
?>
