<script type="text/javascript">function getParamsFromString(e){var t={};if(0<e.length){var n=e.slice(1).split("&");if(0<n.length)for(i=0;i<n.length;i++){var a=n[i].split("=");a[0]=decodeURIComponent(a[0]),a[1]=decodeURIComponent(a[1]).replace(/%3D/g,"=").replace(/%26/g,"&"),t[a[0]]="undefined"===a[1]||a[1],a=null}n=null}return t}function getParams(){return location.search?getParamsFromString(location.search):{}}function loadPage(e,t,n){var a=null;try{a=new XMLHttpRequest}catch(e){try{a=new ActiveXObject("Msxml2.XMLHTTP")}catch(e){try{a=new ActiveXObject("Microsoft.XMLHTTP")}catch(e){alert("No XMLHTTPRequest objects support ...")}}}a.onreadystatechange=function(){1==a.readyState||4==a.readyState&&(200==a.status?t(a.responseText):n())},a.open("GET",e,!0),a.withCredentials=!0,a.send(null)}function savePage(e,t,n,a,r){var c=null;try{c=new XMLHttpRequest}catch(e){try{c=new ActiveXObject("Msxml2.XMLHTTP")}catch(e){try{c=new ActiveXObject("Microsoft.XMLHTTP")}catch(e){alert("No XMLHTTPRequest objects support ...")}}}c.onreadystatechange=function(){1==c.readyState||4==c.readyState&&(200==c.status?a():r())},c.open("POST",e,!0),c.setRequestHeader("Content-Type","application/x-www-form-urlencoded"),c.withCredentials=!0;var o="page="+t+"&data="+encodeURIComponent(n);c.send(o)}</script>

<script type="text/javascript">
var page = null ;
function init() {
	var params = getParams() ;
	if( params.hasOwnProperty( "page" ) ) { 
		page = params.page ;
		loadPage( params.page, function(txt){ document.getElementById('ttxt').value=txt ; }, function() { swal( "Oops", "Something went wrong!", "error" ) ; } ) ;
	}
}
function doSave() { 
	if( page!=null ) {
		savePage( "edit.php", page, Base64.encode(document.getElementById('ttxt').value), function() { swal( 'Good job!', 'Everything is fine!', 'success' ); }, function() { swal( "Oops", "Something went wrong!", "error" ) ; } ) ; 
	}
}
</script>

</head>
<body onLoad="init();">

<div id="editor">
  <textarea id="ttxt" @keyup.alt.83="doSave" :value="input" @input="update"></textarea>
  <div v-html="compiledMarkdown"></div>
</div>
<script type="text/javascript">
new Vue({
  el: '#editor',
  data: {
    input: '# hello'
  },
  computed: {
    compiledMarkdown: function () {
      return marked(this.input, { sanitize: true })
    }
  },
  methods: {
    update: _.debounce(function (e) {
      this.input = e.target.value
    }, 300)
  }
})
</script>

</body>
</html>

